import React from "react"
import Symbols from "./Symbols"
import './style.css';

function Desktop() {
  return (
    <div id="desktop">
      <img
          src="art-web\src\pics\header_photo.JPG" 
          alt="berserk" 
      />
      <Symbols title= "Spotify" icon= ""/> 
      <Symbols title= "Thoughts.pdf" icon= ""/>
      <Symbols title= "Shop?" icon= ""/>
      <Symbols title= "Work" icon= ""/>
    </div>
  );
}

export default Desktop;
